import React from 'react'
import { View, Text, StyleSheet, Image, SafeAreaView, Button, InteractionManager} from "react-native";

export default function TicketBookingDetail() {
    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            <Text>Ticket booking details</Text>
        </View>
    )
}
